window.bookSummaryJSON = "<p><i>What do you do when your planet runs out of women? Send for takeout, of course.</i></p> <p>Vadir has a business empire to run and no time to spare on frivolous endeavors. So how did he wind up on the far side of the galaxy to claim a mate he never signed up for? A matchmaking queen and a royal decree, that’s how.</p> <p>His plan is simple: meet the female, negotiate terms, and leave the primitive planet of Earth as fast as he can. What could possibly go wrong?</p> <p>This audiobook contains a bohemian blonde with a hell of a right hook and an interstellar tycoon who is about to learn that the best things in life can't be bought or sold, they have to be won.</p>"; 
